(792, 'Romario', 'Jarrett', 'M', 'F', '1994-07-19', 1, '1', 'I am a mysterious sign, filled with contradictions. I want security and comfort yet seek new adventure. I am very helpful to others yet sometimes can be cranky and indifferent. I have a driving, forceful personality that can be easily hidden beneath a \r\ncalm, and cool exterior. My ruling spirit suits me well, I can come out of my shell and fight but I can also hide in my shell and skitter away back into the depths of the ocean. I am very unpredictable. With me, there is always something more that meets the eye, for they are always partially hidden behind the shell. \r\n\r\nI have a have a deep psyche and intuitive mind \r\nthat is hidden from the world. I am deeply sensitive and easily hurt, this might be why I have my defense shell in place, to avoids being hurt by others. I am nurturers so I surround myself with people, whom after a while can offend or hurt me without even knowing they did so, therefore my protective shell keeps me safe from hurt. I am complex, fragile, unpredictable and temperamental and need constant support and encouragement, more then any other, I need to be needed. When I get the support I need, I have a tremendous amount to offer in return. When I get offended, I tend to sulk instead of confronting the persons face to face. This needlessly prolongs the pain and suffering. I am very possessive, not just with material possessions but with people as well.\r\n\r\n I will always want to stay in touch with old friends and anyone who has ever been close to them, because it is easier to maintain a friendship then attempt to learn to trust a new person. It is easier this way for me emotionally. If you befriend a me, you will stay friends for a long time. . I have unconditional love and caring more so then any other. I am very intuitive. I have an excellent memory and are very observant and can read people very well. I can usually tell of other people''s intentions are good or not. Never dupe me, I can see your motives.I have a lot of emotional issues to deal with but once I overcome this large hump of shyness and insecurity, there is practically nothing they can''t do. With me strong intuition, sensitivity, powers of observation and intelligence, I will have great success in anything I undertake.', 'romariojarrett@yahoo.com', '5f4dcc3b5aa765d61d8327deb882cf99', 106, 1655, 4, 13, 100000081080578, '2013-05-04 18:57:39', '2013-05-04 21:13:08'),
